import React, { Component } from 'react';
import Loader from '../../shared/loader/loader'
import UniversityList from '../../Components/universityList';
import UniversityFilter from '../../Components/universityFilter';
import Header from 'shared/header/header.js'

class Home extends Component {

    componentDidMount () {
       const { getAllUniversity, getBucket }  = this.props 
       getAllUniversity();
       getBucket()
    }

    render() {
        const { fetchingUniversities, universities } = this.props; 
        return <div> <UniversityFilter/> <Header/> { fetchingUniversities ? <Loader/> : <UniversityList universityArray={universities} title = "All Universities"/>}

        </div>
    }
}
export default Home;
